import "./Popup.css"

const Popup = () =>{
    return (
        <article className="popup">
            <input type="text" className="popup__input">
            <label htmlFor="name" className="popup__label" id="name"/>
            </input>
            <button className="popup__button">Voeg toe</button>
        </article>
    )
}
export default Popup;
